import './App.css';

function App() {
  return (
    <div>
      <button class="btn btn-primary px-16 ">Button</button>
      <button class="btn btn-primary px-16">One</button>
      <button class="btn btn-secondary px-16">Two</button>
      <button class="btn btn-accent btn-outline px-16">Three</button>
    </div>
  );
}

export default App;
